class Solution:
    def maxOperations(self, s: str) -> int:
        moves = 0
        ones = 0
        zeros = False
        for x in s:
            if x == '1':
                if zeros:
                    moves += ones
                    zeros = False
                ones += 1
            elif x == '0':
                zeros = True
        if zeros:
            moves += ones
        return moves
